import React, { useEffect, useState } from 'react';

const ListaContatos = () => {
  const [contatos, setContatos] = useState([]);
  const [contatoSelecionado, setContatoSelecionado] = useState(null);

  useEffect(() => {
    const fetchContatos = async () => {
      try {
        const response = await fetch('https://my.api.mockaroo.com/lestetelecom/test.json?key=f55c4060');
        const data = await response.json();
        setContatos(data);
      } catch (error) {
        console.error('Erro ao obter os contatos:', error);
      }
    };

    fetchContatos();
  }, []);

  const handleEditarClick = (id) => {
    const contato = contatos.find((contato) => contato.id === id);
    setContatoSelecionado(contato);
  };

  const handleExcluirClick = (id) => {
    // Lógica para excluir o contato com o ID fornecido
    console.log('Excluir contato:', id);
  };

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setContatoSelecionado((prevContato) => ({
      ...prevContato,
      [name]: value,
    }));
  };

  const handleSalvarEdicao = () => {
    // Lógica para salvar as alterações do contato
    console.log('Contato editado:', contatoSelecionado);
    setContatoSelecionado(null);
  };

  return (
    <div style={{ maxWidth: '600px', margin: '0 auto', gap: '5px' }}>
      {contatos.map((contato) => (
        <div key={contato.id} style={{ display: 'flex', border: '1px solid #12A146', padding: '10px' }}>
          <img src={contato.avatar} alt="Avatar" style={{ width: '100px', height: '100px', marginRight: '10px' }} />
          <div>
            {contatoSelecionado && contatoSelecionado.id === contato.id ? (
              <div>
                <div>
                  <label>First Name:</label>
                  <input type="text" name="first_name" value={contatoSelecionado.first_name} onChange={handleInputChange} />
                </div>
                <div>
                  <label>Last Name:</label>
                  <input type="text" name="last_name" value={contatoSelecionado.last_name} onChange={handleInputChange} />
                </div>
                <div>
                  <label>Email:</label>
                  <input type="text" name="email" value={contatoSelecionado.email} onChange={handleInputChange} />
                </div>
                <div>
                  <label>Gender:</label>
                  <input type="text" name="gender" value={contatoSelecionado.gender} onChange={handleInputChange} />
                </div>
                <div>
                  <button onClick={handleSalvarEdicao} style={{ backgroundColor: '#12A146', color: '#FFFFFF', padding: '10px 20px', border: 'none', borderRadius: '5px', cursor: 'pointer', marginRight: '5px', marginLeft: '0px', marginTop: '10px', marginBottom: '10px' }}>Salvar</button>
                </div>
              </div>
            ) : (
              <>
                <p>Nome: {contato.first_name} {contato.last_name}</p>
                <p>Email: {contato.email}</p>
                <p>Gênero: {contato.gender}</p>
                <p>Idioma: {contato.language}</p>
                <p>Data de Nascimento: {contato.birthday}</p>
              </>
            )}
            <div style={{ display: 'flex', justifyContent: 'flex-end' }}>
              <button onClick={() => handleEditarClick(contato.id)} style={{ backgroundColor: '#12A146', color: '#FFFFFF', padding: '10px 20px', border: 'none', borderRadius: '5px', cursor: 'pointer', marginRight: '5px', marginLeft: '0px', marginTop: '10px', marginBottom: '10px' }}>Editar</button>
              <button onClick={() => handleExcluirClick(contato.id)} style={{ backgroundColor: '#12A146', color: '#FFFFFF', padding: '10px 20px', border: 'none', borderRadius: '5px', cursor: 'pointer', marginRight: '5px', marginLeft: '5px', marginTop: '10px', marginBottom: '10px' }}>Excluir</button>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default ListaContatos;
